ISLAMABAD, Jan 31 (APP): Outgoing Secretary Cabinet Division Sardar Ahmed Nawaz Sukhera paid a farewell call on Prime Minister Muhammad Shehbaz Sharif here on Tuesday.
The Prime Minister appreciated Sardar Ahmed Nawaz Sukhera for rendering valuable services in Pakistan Civil Service and expressed his good wishes the outgoing Secretary Cabinet Division.
